func TestMinSubarray(t *testing.T){
    // 1
    assert.Equal(t,minSubarray([]int{3,1,4,2},6),1) // 10 % 6 == 4
    // 2
    assert.Equal(t,minSubarray([]int{6,3,5,2},9),2)
    // 0
    fmt.Println(minSubarray([]int{1,2,3},3), 0)
    // -1
    fmt.Println(minSubarray([]int{1,2,3},7))
    
    // 1
    fmt.Println(minSubarray([]int{4,5,8,5,4},7))
    
    // -1
    fmt.Println(minSubarray([]int{4,4,2},7))
    
    // 0
    fmt.Println(minSubarray([]int{1},1))
    
    /**
    [26,19,11,14,18,4,7,1,30,23,19,8,10,6,26,3]
    26
     */
    assert.Equal(t, minSubarray([]int{26,19,11,14,18,4,7,1,30,23,19,8,10,6,26,3}, 26), 3)
    
}
func TestLongestUnivaluePath(t *testing.T){
    tree := TreeNode{
       Val:   5,
       Left:  &TreeNode{
           Val:   4,
           Left:  &TreeNode{
               Val:   1,
               Left:  nil,
               Right: nil,
           },
           Right: &TreeNode{
               Val:   1,
               Left:  nil,
           },
       },
       Right: &TreeNode{
           Val:   5,
           Left:  nil,
           Right: &TreeNode{
               Val:   5,
               Left:  nil,
           },
       },
    }
    fmt.Println(longestUnivaluePath(&tree))
    // [1,null,1,1,1,1,1,1]
    tree2 := &TreeNode{
       Val:   1,
       Left:  nil,
       Right: &TreeNode{
           Val:   1,
           Left:  &TreeNode{
               Val:   1,
               Left:  &TreeNode{
                   Val:   1,
                   Left:  nil,
                   Right: nil,
               },
               Right: &TreeNode{
                   Val:   1,
                   Left:  nil,
                   Right: nil,
               },
           },
           Right: &TreeNode{
               Val:   1,
               Left:  &TreeNode{
                   Val:   1,
                   Left:  nil,
                   Right: nil,
               },
               Right: nil,
           },
       },
    }
    fmt.Println(longestUnivaluePath(tree2))
    tree3 := &TreeNode{
        Val:   1,
        Left:  &TreeNode{
            Val:   2,
            Left:  &TreeNode{
                Val:   4,
                Left:  nil,
                Right: nil,
            },
            Right: &TreeNode{
                Val:   2,
                Left:  nil,
                Right: nil,
            },
        },
        Right: &TreeNode{
            Val:   3,
            Left:  nil,
            Right: nil,
        },
    }
    fmt.Println(longestUnivaluePath(tree3))
}

